import React from "react";
import { Typography, Divider, Container } from "@material-ui/core";

export const MyFooter = () => {
  return (
    <React.Fragment>
      <Divider />
      <Container>
        <Typography variant="caption">Created by Raphael</Typography>
      </Container>
      <footer>Created by Raphael</footer>
      <style jsx>{`
        footer {
          width: 100%;
          height: 100px;
          border-top: 1px solid #eaeaea;
          display: flex;
          justify-content: center;
          align-items: center;
        }
      `}</style>
    </React.Fragment>
  );
};
